import React, { useState } from 'react'

export default function UserView({ r }) {

    const [node, setNode] = useState(false)

    const nodeClick = () => {
        setNode(!node)
        // console.log(r.nodes)
        // debugger
    }

    const nodes = Object.keys(r.nodes).map((n => {
        // console.log(n)
        if (n === r.lastNode){
            return <li key={n} style={{color: 'green'}}>
                {n}
            </li>
        } else {
            return <li key={n}>
                {n}
            </li>
        }
    }))

  return (
    <li className='user-view' style={{width: '50%'}}>
        <div>
            Name: {r.name}
        </div>
        <div>
            E-mail: {r.email}
        </div>
        <button onClick={nodeClick} style={{top: '0', float: 'right'}}>Check Nodes</button>
        {/* {r.nodes} */}
        {node ? <>
            <ol>
                {nodes}
            </ol>
        </>:<></>}
    </li>
  )
}
